من الغفلة العظيمة أن تنسى أن ذنوبك هي سبب مصائبك
والله يقول {وما أصابكم من مصيبة فبما كسبت أيديكم}
قال ابن سعدي: "يخبر تعالى أنه ما أصاب العباد من مصيبة في أبدانهم وأموالهم وأولادهم وفيما يحبون ويكون عزيزا عليهم،إلا بسبب ما قدمته أيديهم من السيئات،وأن ما يعفو اللّه عنه أكثر"
